import React from 'react';
import { connect } from 'react-redux';

import Label from './Label';
import TextField from './TextField';

class Form extends React.Component {

    render() {
        return (
            <div className="formDiv">
                <form className="formDiv__form">
                    <Label section={this.props.currentSection} className="formDiv__form--label" />
                        <TextField name={this.props.currentSection} />
                        <button type="submit" className="form__button">Next</button>
                </form>
            </div>
        )
    }
}

const mapStateToProps = state => {
    return { currentSection: state.currentSection }
};

export default connect(mapStateToProps)(Form);
